import "./LivroEstante.css";

function LivroEstante(props) {
  if (props.escolhido) {
    return <div key={props.key} className="LivroEstanteEscolhido"></div>;
  } else {
    return <div key={props.key} className="LivroEstante"></div>;
  }
}
export default LivroEstante;
